import React, { useState } from 'react';
import { Form, Button } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

const VendorRegistrationForm = () => {
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");
  const [passwordStrength, setPasswordStrength] = useState({
    score: 0,
    color: "danger",
    message: "Too weak"
  });
  const [formData, setFormData] = useState({
    businessName: "",
    email: "",
    password: "",
    // ... other form fields
  });
  
  const navigate = useNavigate();

  const checkPasswordStrength = (password) => {
    let score = 0;
    let color = "danger";
    let message = "Too weak";

    // Length check
    if (password.length >= 8) score++;

    // Uppercase check
    if (/[A-Z]/.test(password)) score++;

    // Lowercase check
    if (/[a-z]/.test(password)) score++;

    // Number check
    if (/[0-9]/.test(password)) score++;

    // Special character check
    if (/[^A-Za-z0-9]/.test(password)) score++;

    // Set color and message based on score
    if (score === 5) {
      color = "success";
      message = "Very strong";
    } else if (score === 4) {
      color = "info";
      message = "Strong";
    } else if (score === 3) {
      color = "warning";
      message = "Moderate";
    } else if (score === 2) {
      color = "danger";
      message = "Weak";
    }

    setPasswordStrength({ score, color, message });
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name === 'password') {
      checkPasswordStrength(value);
    }
    // ... rest of handleChange function
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError("");
    
    // Validate password strength
    if (passwordStrength.score < 3) {
      setError("Please create a stronger password with at least 8 characters, including uppercase, lowercase, numbers, and special characters");
      setLoading(false);
      return;
    }
    
    // ... rest of the handleSubmit function
  };

  return (
    <div className="container mt-5">
      <div className="row justify-content-center">
        <div className="col-md-8">
          <div className="card shadow-lg">
            <div className="card-body p-5">
              <h2 className="text-center mb-4">Vendor Registration</h2>
              {error && <div className="alert alert-danger">{error}</div>}
              
              <Form onSubmit={handleSubmit}>
                <Form.Group className="mb-3">
                  <Form.Label>Business Name *</Form.Label>
                  <Form.Control
                    type="text"
                    name="businessName"
                    value={formData.businessName}
                    onChange={handleChange}
                    placeholder="Enter business name"
                    required
                    className="form-control-lg"
                  />
                </Form.Group>

                <Form.Group className="mb-3">
                  <Form.Label>Email *</Form.Label>
                  <Form.Control
                    type="email"
                    name="email"
                    value={formData.email}
                    onChange={handleChange}
                    placeholder="Enter email"
                    required
                    className="form-control-lg"
                  />
                </Form.Group>

                <Form.Group className="mb-3">
                  <Form.Label>Password *</Form.Label>
                  <Form.Control
                    type="password"
                    name="password"
                    value={formData.password}
                    onChange={handleChange}
                    placeholder="Enter password"
                    required
                    className="form-control-lg"
                    isInvalid={formData.password && passwordStrength.score < 3}
                  />
                  {formData.password && (
                    <div className="mt-2">
                      <div className="d-flex justify-content-between align-items-center">
                        <span className={`text-${passwordStrength.color} small fw-bold`}>
                          {passwordStrength.message}
                        </span>
                        <div className="progress" style={{ height: "8px", width: "70%" }}>
                          {[...Array(5)].map((_, index) => (
                            <div
                              key={index}
                              className={`progress-bar bg-${index < passwordStrength.score ? passwordStrength.color : "secondary"}`}
                              role="progressbar"
                              style={{ width: "20%", opacity: index < passwordStrength.score ? 1 : 0.2 }}
                              aria-valuenow="20"
                              aria-valuemin="0"
                              aria-valuemax="100"
                            ></div>
                          ))}
                        </div>
                      </div>
                      <small className="text-muted">
                        Password must contain at least 8 characters, including uppercase, lowercase, numbers, and special characters.
                      </small>
                    </div>
                  )}
                </Form.Group>

                <div className="d-flex justify-content-between mt-4">
                  <Button
                    variant="secondary"
                    onClick={() => navigate('/login')}
                    className="btn-lg"
                  >
                    Cancel
                  </Button>
                  <Button
                    type="submit"
                    variant="primary"
                    disabled={loading}
                    className="btn-lg"
                  >
                    {loading ? 'Registering...' : 'Register'}
                  </Button>
                </div>
              </Form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default VendorRegistrationForm;
